    <style>
    /* Responsive inline SVG */
    svg { max-width: 100%; height: auto; display: block; }

    /* Hoverable towns */
    .towns-svg {
      cursor: pointer;
      transition: fill 500ms ease, stroke 500ms ease;
    }
    .towns-svg:hover {
      fill: #616161;
      stroke: #bc1e2d;
      stroke-width: 2;
      vector-effect: non-scaling-stroke;
    }

    /* Ensure text labels don't block pointer events but remain visible */
    .towns-text { 
      pointer-events: none; 
      paint-order: stroke fill;
      transition: fill 500ms ease;
    }

    /* Simple UI */
    .controls {
      display: flex; gap: 1rem; align-items: center;
      font-family: system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif;
      padding: .75rem 1rem; background: #f5f5f5; border-bottom: 1px solid #e5e5e5;
      position: sticky; top: 0; z-index: 10;
    }
    .controls label { display: inline-flex; align-items: center; gap: .5rem; }
    .controls input[type="checkbox"] { width: 1rem; height: 1rem; }
  </style>

  <script>
    (function () {
      function ready(fn){ if(document.readyState!=='loading') fn(); else document.addEventListener('DOMContentLoaded',fn); }
      ready(function(){

        var svg = document.querySelector('svg');
        if(!svg) return;

        // 1) Make .towns-text render on top by moving to a top-level labels layer at the end
        var labelsLayer = svg.querySelector('#labels-layer');
        if(!labelsLayer) {
          labelsLayer = document.createElementNS('http://www.w3.org/2000/svg','g');
          labelsLayer.setAttribute('id','labels-layer');
          svg.appendChild(labelsLayer); // append at end => on top
        }
        svg.querySelectorAll('.towns-text').forEach(function(txt){ 
          try { labelsLayer.appendChild(txt); } catch(e){ /* ignore */ }
        });

        // 2) Add hover affordance for keyboard users (optional focus handling)
        svg.querySelectorAll('.towns-svg').forEach(function(node){ 
          if(!node.hasAttribute('tabindex')) node.setAttribute('tabindex','0'); 
          node.addEventListener('focus', function(){ 
            node.style.fill = '#616161';
            node.style.stroke = '#bc1e2d';
            node.style.strokeWidth = '2';
          });
          node.addEventListener('blur', function(){ 
            node.style.fill = '';
            node.style.stroke = '';
            node.style.strokeWidth = '';
          });
        });

        // Utility: show/hide by selector (handles both id and class forms)
        function setVisibility(selectorList, visible) {
          selectorList.forEach(function(sel){
            svg.querySelectorAll(sel).forEach(function(el){
              el.style.display = visible ? '' : 'none';
            });
          });
        }

        // 3) Wire up toggles for roads and lake
        var roadsBtn = document.getElementById('toggle-roads');
        var lakeBtn  = document.getElementById('toggle-lake');

        var roadsVisible = true;
        var lakeVisible = true;

        function syncRoads(){ setVisibility(['#roads', '.roads'], roadsVisible); roadsBtn.textContent = (roadsVisible ? 'Hide roads' : 'Show roads'); }
        function syncLake() { setVisibility(['#lake', '.lake'],   lakeVisible); lakeBtn.textContent   = (lakeVisible  ? 'Hide lake'  : 'Show lake'); }

        roadsBtn.addEventListener('click', function(){ roadsVisible = !roadsVisible; syncRoads(); });
        lakeBtn.addEventListener('click',  function(){ lakeVisible  = !lakeVisible;  syncLake();  });

        // initial sync
        syncRoads();
        syncLake();
        syncRoads();
        syncLake();
      });
    })();
  </script>
